import { Box, Typography } from "@mui/material";
import React from "react";

const Item = () => {
  return (
    <Box sx={{ display: "flex", flexDirection: "column", width: "200px" }}>
      <img
        src="../public/logo192.png"
        style={{ width: "264px", height: "210px" }}
      />
      <Box sx={{ display: "flex", justifyContent: "space-between" }}>
        <Typography>상품이름</Typography>
        <Typography>% or 관심 고객수</Typography>
      </Box>
      <Box sx={{ display: "flex", justifyContent: "space-between" }}>
        <Typography>기획전 설명</Typography>
        <Typography>가격 or 고객수</Typography>
      </Box>
    </Box>
  );
};

export default Item;
